function Content() {
  return (
    <div className="hero-content">
      <h3>An Upscale Lifestyle Destination</h3>
      <p>
        New Cairo's future business hub, creates an effective business community
        aiming to create the most ideal and efficient work environment.
      </p>
      <ul className="tfx">
        <PagesLink>Check it out</PagesLink>
      </ul>
    </div>
  );
}

function Fact({ name, number }: { name: string; number: string }) {
  const arr = new Array(number.length).fill();
  return (
    <li className="fact">
      <h4>{name}</h4>
      <div>
        {arr.map((_, idx) => {
          let length = +number.slice(0, idx + 1) + 1;
          length = length > 20 ? 20 + (length % 20) : length;
          const numbers = new Array(length || 1).fill(null);

          return (
            <React.Fragment key={idx}>
              {(idx + 1) % 4 ? "" : ","}
              <ul className={numbers.length > 1 ? "up" : ""}>
                {numbers.map((_, i) => (
                  <li key={i}>{i % 10}</li>
                ))}
              </ul>
            </React.Fragment>
          );
        })}
      </div>
    </li>
  );
}

export function Thumb({ idx, length, onClick }: Index) {
  const YPosition = (100 / (length * 2)) * idx;

  const handlePosition = () => {
    onClick();

    gsap.to(".thumbs-wrap", {
      duration: 1.4,
      ease: "power4.inOut",
      y: `-${YPosition}%`,
      onComplete: () => {
        if (idx === length) gsap.set(".thumbs-wrap", { y: "0%" });
      },
    });
  };

  return (
    <li className="thumb" onClick={handlePosition}>
      <div className="thumb-wrap">
        <span className="thumb-bg">
          {/* <img
            src="https://images.unsplash.com/photo-1729552048052-24a21a7821ef?w=400&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxmZWF0dXJlZC1waG90b3MtZmVlZHw4fHx8ZW58MHx8fHx8"
            alt=""
          /> */}
        </span>
        <span className="thumb-hover">
          {/* <img
            src="https://images.unsplash.com/photo-1719937206220-f7c76cc23d78?w=400&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDF8MHxmZWF0dXJlZC1waG90b3MtZmVlZHwyMXx8fGVufDB8fHx8fA%3D%3D"
            alt=""
          /> */}
        </span>
      </div>
    </li>
  );
}

export function HeroImage({ idx, banner, length }: Index) {
  const className = `hero-image-${idx}`;
  const YPosition = (100 / length) * idx;

  useEffect(() => {
    if (idx === banner) {
      gsap.to(".heros-images", {
        duration: 1.4,
        ease: "power4.inOut",
        y: `-${YPosition}%`,
      });
      gsap.to(`.${className} img`, {
        duration: 1.4,
        ease: "power4.inOut",
        scale: 1,
      });
    } else {
      gsap.to(`.${className} img`, {
        duration: 1.4,
        ease: "power4.inOut",
        scale: 1.4,
      });
    }
  }, [banner]);

  return (
    <div className={`hero-image ${className}`}>
      <Image
        width={1920}
        height={1480}
        src="/assets/media/hero-cover.jpg"
        alt="hero-cover"
        priority
      />
    </div>
  );
}

export function Hero({ idx, banner }: Index) {
  const factsRef = useRef(null);
  const className = `hero-${idx}`;

  useEffect(() => {
    splitText(`.${className} > h3`, { lines: true });
    splitText(`.${className} .hero-content h3`, { lines: true });
    splitText(`.${className} .hero-content p`, { lines: true });
  }, []);

  useEffect(() => {
    if (idx === banner) {
      gsap.fromTo(
        `.${className} .tfx`,
        {
          y: "105%",
          opacity: 0,
        },
        {
          duration: 0.7,
          delay: 1,
          stagger: 0.03,
          ease: "expo.out",
          y: "0%",
          opacity: 1,
          pointerEvents: "all",
        }
      );
      gsap.from(`.${className} #draw`, {
        duration: 1,
        delay: 2,
        drawSVG: 0,
      });
      gsap.to(`.${className} .up`, {
        scrollTrigger: {
          trigger: ".hero-facts",
          start: "top bottom",
          toggleActions: "restart",
        },
        duration: 1,
        y: "-100%",
      });
      gsap.set(`.${className} .hero-facts`, {
        opacity: 1,
      });
    } else {
      gsap.to(`.${className} .tfx`, {
        duration: 1,
        stagger: 0.025,
        ease: "power2.inOut",
        y: "-105%",
        opacity: 0,
        pointerEvents: "none",
      });
      gsap.set(`.${className} .hero-facts`, {
        opacity: 0,
      });
    }
  }, [banner]);

  return (
    <section className={`hero ${className}`}>
      <h3>Cityscape Limited-time offer</h3>
      <VideoPlayer />
      <Content />
      <ul className="hero-facts" ref={factsRef}>
        <Fact name="Developments" number="13" />
        <Fact name="Downpayment" number="0" />
        <Fact name="Installment years up to" number="10" />
        <Fact name="Discount %" number="1230" />
      </ul>
    </section>
  );
}
